import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import GTM from './Assets/GTM'


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <GTM />
    <App />
  </React.StrictMode>
